import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav>
          <img src="src/images/amazon-logo.png" alt="logo"/>
        </nav>

      </header>
    </div>
  );
}

export default App;
